    "content": "<ComponentPreview name=\"badge\" withRecipe />\n\n## Installation\n\n<Steps>\n### Copy and paste the following code into your project\n\n<ComponentSource name=\"badge\" />\n\n### Update the import paths to match your project setup\n\n</Steps>\n\n## Usage\n\n```tsx\nimport { Badge } from '@/components/ui/badge'\n```\n\n```tsx\n<Badge variant=\"default\">Badge</Badge>\n```\n\n## Recipe\n### Usage\n```tsx\nimport { badge, type BadgeVariantProps } from '@styled-system/recipes'\n```\n```tsx\n<span className={badge({ variant: 'primary' })}>Badge</span>\n```\n\n### Link\n\n```tsx\nimport { badge } from '@styled-system/recipes'\n```\n```tsx\n<Link className={badge({ variant: 'default' })}>Click here</Link>\n```\n\n## Examples\n### Default\n\n<ComponentPreview name=\"badge\" />\n\n### Outline\n\n<ComponentPreview name=\"badge\" file=\"primary\" />\n\n### Dashed\n\n<ComponentPreview name=\"badge\" file=\"error\" />\n\n### Link\n\n<ComponentPreview name=\"badge\" file=\"with-icon\" />",
